import { Container } from "react-bootstrap";
import ReactPlayer from "react-player/youtube";

const Jumbotron = () => {
  return (
    <Container className="jumbotron" fluid>
      <video
        src="https://youtu.be/pKJKH5uyHA4"
        id="video-background"
        preload
        autoplay
        loop
        muted
      >
        <source src="https://youtu.be/pKJKH5uyHA4" type="video/mp4" />
      </video>
      <ReactPlayer url="https://youtu.be/pKJKH5uyHA4" />
      <div>
        <h1>THE PREMIER GAMING LOUNGE</h1>
        <h6>Play, eat, enjoy in our upscale game lounge</h6>
      </div>
    </Container>
  );
};
export default Jumbotron;
